try{new Swiper(".footerSwiper",{slidesPerView:3,grid:{rows:2},speed:2500,spaceBetween:20,autoplay:{delay:1500,disableOnInteraction:!1},slidesPerGroupSkip:1})}catch(e){console.log(e)}try{const o=window.SimpleKeyboard.default,n=window.SimpleKeyboardLayouts.default,t=new o({onChange:e=>onChange(e),onKeyPress:e=>onKeyPress(e),...(new n).get("russian")});function onChange(e){document.querySelector(".search-page__input").value=e,console.log("Input changed",e)}function onKeyPress(e){console.log("Button pressed",e),"{shift}"!==e&&"{lock}"!==e||handleShift()}function handleShift(){let e="default"===t.options.layoutName?"shift":"default";t.setOptions({layoutName:e})}}catch(s){console.log(s)}